import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <nav class="navbar navbar-light bg-light" id="navbar">
          <a href="/" class="navbar-brand mx-auto">
            Datos Ubicación
          </a>
        </nav>
        <table class="table">
        <thead>
          <tr>
              <th>ID</th>
              <th>Fecha</th>
              <th>Latitud</th>
              <th>Longitud</th>
          </tr>
        </thead> 

  </table>
      </div>
    );
  }
}

export default App;
